import { StatusBar } from "expo-status-bar";
import React from "react";
import {
  Image,
  StyleSheet,
  View,
  ScrollView,
  SafeAreaView,
  Text,
  TouchableOpacity,
} from "react-native";
import CustomButton from "./CustomButton";

function Places(props) {
  return (
      
    <SafeAreaView>
      <ScrollView
        contentContainerStyle={{
          flexGrow: 1,
          alignItems: "center",
          paddingTop: 30,
        }}
      >
        <View style={styles.ItemContainer2}>
          <Image
            style={styles.imageContain}
            source={require("../assets/indiagate.jpg")}
          />
          <Text style={styles.titleText}>India Gate</Text>
        </View>

        <View style={styles.ItemContainer1}>
          <Image
            style={styles.imageContain}
            source={require("../assets/jamamasjid.jpg")}
          />
          <Text style={styles.titleText}>Jama Masjid</Text>
        </View>

        <View style={styles.ItemContainer2}>
          <Image
            style={styles.imageContain}
            source={require("../assets/humayun.jpg")}
          />
          <Text style={styles.titleText}>Humayun's Tomb</Text>
        </View>

        <View style={styles.ItemContainer1}>
          <Image
            style={styles.imageContain}
            source={require("../assets/redfort.jpg")}
          />
          <Text style={styles.titleText}>Red Fort</Text>
        </View>
      </ScrollView>
      <View style={styles.buttonPos}>
          <CustomButton title='Charter Route' onPress={console.log("ok")}></CustomButton>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  ItemContainer1: {
    marginTop: 10,
    flexDirection: "column",
    width: "95%",
    height: 350,
    alignItems: "center",
    backgroundColor: "#fc5c65",
  },

  ItemContainer2: {
    marginTop: 10,
    flexDirection: "column",
    width: "95%",
    height: 350,
    alignItems: "center",
    backgroundColor: "#4ecdc4",
  },

  imageContain: {
    marginTop: 8.75,
    height: 280,
    width: "95%",
  },

  titleText: {
    marginTop: 5,
    color: "#263089",
    fontSize: 23,
    fontWeight: "bold",
  },

  buttonPos: {
    position: 'absolute',
    height: 25,
    width: 50,
    bottom: 10,
    right: 20,
  }
});
export default Places;
